import React, { useState } from "react";
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';  
import './App.css';

// components
import SelectionPage from './views/selectionPage/SelectionPage';
import ConfirmationPage from './views/confirmationPage/ConfirmationPage';

function App() {
  // global variables
  const [time, setTime] = useState({
    'time': '',
    'weather': '',
  });
  const [weather, setWeather] = useState("");

  return (
    <Router>
        <Routes>
        <Route exact path="/" element={<SelectionPage time={time} decideTime={setTime} setWeather={setWeather} />} />
        <Route path="/confirm" element={<ConfirmationPage time={time} weather={weather} />} />
        </Routes>
    </Router>
  );
}

export default App;
